import styled from '@emotion/styled'

const Nav = styled.nav`
  position: fixed;
  height: 100vh;
  width: 210px;
  left: 0px;
  top: 0px;
  background: #FFFFFF;
  margin: 0;
`
const A = styled.a`
    display: block;
    padding-bottom: 13px;
    padding-left: 35px;
    text-decoration: none;
    font-family: Jost;
    font-style: normal;
    font-weight: normal;
    font-size: 13px;
    line-height: 19px;
    color: rgba(0, 0, 0, 0.5);
    cursor: pointer;
`


const Sidebar = () => (
    <div>
        <Nav>
            <A href="#">Занятия</A>
            <A href="#">Учащиеся</A>
            <A href="#">Тренеры</A>
            <A href="#">Финансы</A>
            <A href="#">Абонементы</A>
            <A href="#">Доступ в CRM</A>
            <A href="#">Рассылки</A>
            <A href="#">Отчеты</A>
            <A href="#">Настройки</A>
        </Nav>
    </div>
)

export default Sidebar;
